import React, { useState } from "react";
import {
  Container,
  Typography,
  TextField,
  Button,
  Grid,
  Link,
} from "@mui/material";
import {
  GoogleLoginButton,
  FacebookLoginButton,
} from "react-social-login-buttons";
//import { useHistory } from "react-router-dom";
import "../styles/styles.css";

function JoinUS() {
  const [isSignUp, setIsSignUp] = useState(false);
  const [username, setUsername] = useState("");
  const [email, setEmail] = useState("");
  const [dob, setDob] = useState("");
  const [password, setPassword] = useState("");
  const [verifyPassword, setVerifyPassword] = useState("");

  const handleToggleMode = () => {
    setIsSignUp((prevState) => !prevState);
  };

  const handleSignIn = (e) => {
    e.preventDefault();
    // Check the username and password
    if (username === "admin" && password === "admin") {
      // Redirect to admin dashboard
      console.log("Redirecting to admin dashboard...");
      // Add logic to redirect to admin dashboard
    } else {
      // Redirect to regular user dashboard
      console.log("Redirecting to regular user dashboard...");
      // Add logic to redirect to regular user dashboard
    }
  };

  const handleSignUp = (e) => {
    e.preventDefault();
    // Add sign-up logic here
  };

  return (
    <Container maxWidth="xs" style={{ marginLeft: "10%", width: "80%" }}>
      <div
        style={{
          marginTop: "2rem",
          display: "flex",
          flexDirection: "column",
          alignItems: "center",
        }}
      >
        <div
          style={{
            display: "flex",
            justifyContent: isSignUp ? "space-between" : "center",
            alignItems: "center",
            marginBottom: isSignUp ? "1rem" : 0,
          }}
        >
          {isSignUp && (
            <div style={{ marginRight: "2rem" }}>
              <img
                src="path/to/your/image"
                alt="Your Image"
                style={{ width: "200px", height: "auto" }}
              />
            </div>
          )}
          <div>
            <Typography variant="h4" gutterBottom>
              {isSignUp ? "Sign Up" : "Sign In"}
            </Typography>
            <form
              style={{ width: "100%", marginTop: "1rem" }}
              noValidate
              autoComplete="off"
              onSubmit={isSignUp ? handleSignUp : handleSignIn}
            >
              {isSignUp && (
                <>
                  <TextField
                    className="form-input"
                    fullWidth
                    id="username"
                    label="Username"
                    variant="outlined"
                    margin="normal"
                    value={username}
                    onChange={(e) => setEmail(e.target.value)}
                  />
                  <TextField
                    className="form-input"
                    fullWidth
                    id="email"
                    label="Email"
                    variant="outlined"
                    margin="normal"
                    value={email}
                    onChange={(e) => setEmail(e.target.value)}
                  />
                  <TextField
                    className="form-input"
                    fullWidth
                    id="password"
                    label="Password"
                    type="password"
                    variant="outlined"
                    margin="normal"
                    value={password}
                    onChange={(e) => setPassword(e.target.value)}
                  />
                  <TextField
                    className="form-input"
                    fullWidth
                    id="verifyPassword"
                    label="Verify Password"
                    type="password"
                    variant="outlined"
                    margin="normal"
                    value={verifyPassword}
                    onChange={(e) => setVerifyPassword(e.target.value)}
                  />
                  <TextField
                    className="form-input"
                    fullWidth
                    id="dob"
                    label="Date of birth"
                    type="date"
                    variant="outlined"
                    margin="normal"
                    value={dob}
                    onChange={(e) => setDob(e.target.value)}
                    InputLabelProps={{
                      shrink: true,
                      style: {
                        transform: "none",
                        position: "static",
                        fontSize: "1rem",
                      },
                    }}
                  />
                </>
              )}

              {!isSignUp && (
                <>
                  <TextField
                    className="form-input"
                    fullWidth
                    id="username"
                    label="Username"
                    variant="outlined"
                    margin="normal"
                    value={username}
                    onChange={(e) => setUsername(e.target.value)}
                  />
                  <TextField
                    className="form-input"
                    fullWidth
                    id="password"
                    label="Password"
                    type="password"
                    variant="outlined"
                    margin="normal"
                    value={password}
                    onChange={(e) => setPassword(e.target.value)}
                  />
                </>
              )}

              <Button
                variant="contained"
                color="primary"
                fullWidth
                style={{ marginTop: "1rem" }}
                type="submit"
              >
                {isSignUp ? "Sign Up" : "Sign In"}
              </Button>
            </form>
          </div>
          {!isSignUp && (
            <div style={{ width: "200px" }}>
              <img
                src="path/to/your/image"
                alt="Your Image"
                style={{ width: "100%", height: "auto" }}
              />
            </div>
          )}
        </div>
        <Typography variant="body2" style={{ marginTop: "1rem" }}>
          Or sign in with:
        </Typography>
        <Grid
          container
          spacing={2}
          justifyContent="center"
          style={{ marginTop: "0.5rem" }}
        >
          <Grid item xs={6}>
            <GoogleLoginButton onClick={() => console.log("Google clicked")} />
          </Grid>
          <Grid item xs={6}>
            <FacebookLoginButton
              onClick={() => console.log("Facebook clicked")}
            />
          </Grid>
        </Grid>
        <Typography variant="body2" style={{ marginTop: "1rem" }}>
          <Link href="#" onClick={() => console.log("Forgot password clicked")}>
            Forgot password?
          </Link>
        </Typography>
        <Typography variant="body2" style={{ marginTop: "1rem" }}>
          {isSignUp ? "Already have an account? " : "Don't have an account? "}
          <Link href="#" onClick={handleToggleMode}>
            {isSignUp ? "Sign in" : "Sign up"}
          </Link>
        </Typography>
      </div>
    </Container>
  );
}

export default JoinUS;
